create table world_maps_scroll_actions
(
    Id           int     not null
        primary key,
    RightExists  tinyint not null,
    BottomExists tinyint not null,
    LeftExists   tinyint not null,
    TopExists    tinyint not null,
    RightMapId   int     not null,
    BottomMapId  int     not null,
    LeftMapId    int     not null,
    TopMapId     int     not null
)
    engine = MyISAM
    charset = utf8;

